import React from "react";

const Song = ({ currentSong }) => {
  return (
    <div className="song-container">
      <div className="image-box">
        <img src={currentSong.cover} alt="" />
      </div>
      <h2>{currentSong.name}</h2>
      <h3>{currentSong.artist}</h3>
      <p>{currentSong.type}</p>
    </div>
  );
};

export default Song;
